import React, { Component } from 'react';

class HomePage extends Component {
  render(){
    return (
      <div>
        <h1>Travel Writing Journal</h1>
        <h2>Your Space for Your Travel Stories</h2>
        <h3>Like to Travel? Like to Write?</h3>
        <p>Keep all your travel stories all in one place.</p>
      </div>
    )
  }
}
export default HomePage;
